Este soneto satírico fue escrito por Cervantes, quien vivió entre 1547 y 1616. El poema hace referencia a una actriz de la época, Josefa Vaca, y a su marido, el actor Juan de Morales Medrano. La última línea "miró al soslayo, fuese y no hubo nada" es particularmente famosa y también aparece en el Quijote.
